import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import {
  Building2, TrendingUp, Users, Calendar, DollarSign,
  Activity, Clock, CheckCircle2, AlertCircle, Sparkles,
  BarChart3, PieChart, ArrowUpRight, ArrowDownRight,
  Bot, Zap, Target, FileText, ExternalLink
} from 'lucide-react';
import {
  AreaChart, Area, BarChart, Bar, PieChart as RechartsPie, Pie, Cell,
  XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Legend
} from 'recharts';
import useStore from '../../store/useStore';
import { maya } from '../../services/agentOrchestrator';
import './EnterpriseDashboard.css';

// Chart data
const revenueData = [
  { name: '×™× ×•', revenue: 320000, bookings: 42 },
  { name: '×¤×‘×¨', revenue: 280000, bookings: 38 },
  { name: '××¨×¥', revenue: 350000, bookings: 48 },
  { name: '××¤×¨', revenue: 420000, bookings: 55 },
  { name: '×××™', revenue: 480000, bookings: 62 },
  { name: '×™×•× ', revenue: 520000, bookings: 68 },
];

const occupancyData = [
  { name: '×ª×¤×•×¡', value: 72, color: '#10b981' },
  { name: '×¤× ×•×™', value: 18, color: '#3b82f6' },
  { name: '×ª×—×–×•×§×”', value: 6, color: '#f59e0b' },
  { name: '× ×™×§×™×•×Ÿ', value: 4, color: '#8b5cf6' },
];

const agentPerformance = [
  { name: 'Scraper', tasks: 156, success: 148 },
  { name: 'Marketing', tasks: 89, success: 82 },
  { name: 'Creative', tasks: 45, success: 43 },
  { name: 'Sales', tasks: 67, success: 58 },
  { name: 'Operations', tasks: 234, success: 228 },
];

const containerVariants = {
  hidden: { opacity: 0 },
  visible: {
    opacity: 1,
    transition: {
      staggerChildren: 0.1,
    },
  },
};

const itemVariants = {
  hidden: { opacity: 0, y: 20 },
  visible: { opacity: 1, y: 0 },
};

const EnterpriseDashboard = () => {
  const { stats, rooms, agents, setDailyReport, setGeneratingReport, isGeneratingReport, dailyReport, lang } = useStore();
  const [activeTab, setActiveTab] = useState('overview');

  const handleGenerateReport = async () => {
    setGeneratingReport(true);
    try {
      const report = await maya.generateDailyReport();
      setDailyReport(report);
    } catch (error) {
      console.error('Error generating report:', error);
    } finally {
      setGeneratingReport(false);
    }
  };

  const isRTL = lang === 'he';

  return (
    <motion.div
      className="enterprise-dashboard"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
      dir={isRTL ? 'rtl' : 'ltr'}
    >
      {/* Header */}
      <motion.div className="dashboard-header" variants={itemVariants}>
        <div className="header-content">
          <h1 className="dashboard-title">
            <Building2 size={32} />
            <span className="text-gradient">LuxuryStay Enterprise</span>
          </h1>
          <p className="dashboard-subtitle">××¢×¨×›×ª × ×™×”×•×œ ××œ×•×Ÿ ×—×›××” ××‘×•×¡×¡×ª AI</p>
        </div>
        <motion.button
          whileHover={{ scale: 1.02 }}
          whileTap={{ scale: 0.98 }}
          onClick={handleGenerateReport}
          disabled={isGeneratingReport}
          className="btn-primary report-btn"
